def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentence = ""
    if not triples:
        return ""

    subject = triples[0].subject
    sentence += f"{subject} "

    for i, triple in enumerate(triples):
        if i == 0:
            if triple.predicate == "architect":
                sentence += f"designed by {triple.object}"
            elif triple.predicate == "location":
                sentence += f"and is located in {triple.object}"
            elif triple.predicate == "buildingStartDate":
                sentence += f"and construction began in {triple.object}"
            elif triple.predicate == "completionDate":
                sentence += f"and was completed in {triple.object}"
            else:
                sentence += f" and {triple.predicate} is {triple.object}"
        else:
            if triple.predicate == "architect":
                sentence += f", which was designed by {triple.object}"
            elif triple.predicate == "completionDate":
                sentence += f" and was completed in {triple.object}"
            elif triple.predicate == "location":
                sentence += f" and is located in {triple.object}"
            else:
                sentence += f" and {triple.predicate} {triple.object}"

    return sentence + "."

